import React from "react";
import { Grid, ListItem, List, Box } from "@material-ui/core";

export default function Footer() {
  return (
    <Box className="body-admin">
      <Grid container spacing={1}>
        <Grid item xs={6}>
          <List>
            <ListItem>Home</ListItem>
          </List>
        </Grid>
      </Grid>
    </Box>
  );
}
